import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { LineChart, Line, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';

const Dashboard = () => {
  const [user, setUser] = useState(null);
  const [selectedToken, setSelectedToken] = useState(null);
  const [chartData, setChartData] = useState([]);
  const [income, setIncome] = useState(0);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      const token = localStorage.getItem('token');
      try {
        const res = await axios.get('https://profitpilot-backend.onrender.com/api/users/profile', {
          headers: { Authorization: `Bearer ${token}` },
        });

        setUser(res.data);
        setIncome(res.data.income || 0);
        if (res.data.tokens.length > 0) {
          const defaultToken = res.data.tokens[0];
          setSelectedToken(defaultToken);

          const chartRes = await axios.get(
            `https://profitpilot-backend.onrender.com/api/tokens/performance/${defaultToken._id}`,
            { headers: { Authorization: `Bearer ${token}` } }
          );
          setChartData(chartRes.data.history || []);
        }
      } catch (err) {
        console.error('Error loading dashboard:', err);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  const handleBoost = async () => {
    const token = localStorage.getItem('token');
    if (!selectedToken) return;

    try {
      const res = await axios.post(
        `https://profitpilot-backend.onrender.com/api/tokens/boost/${selectedToken._id}`,
        {},
        { headers: { Authorization: `Bearer ${token}` } }
      );
      alert('Boost successful!');
      setIncome(res.data.updatedIncome || income);
    } catch (err) {
      alert('Boost failed.');
    }
  };

  if (loading) {
    return <div className="text-center p-8 text-gray-500">Loading Dashboard...</div>;
  }

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }} 
      animate={{ opacity: 1, y: 0 }} 
      transition={{ duration: 0.6 }}
      className="p-4 sm:p-6 md:p-10 bg-gray-100 min-h-screen"
    >
      <div className="max-w-5xl mx-auto">
        <h1 className="text-2xl font-bold mb-4 text-gray-800">Welcome, {user?.username}</h1>

        <div className="grid gap-6 md:grid-cols-2">
          {/* Chart Card */}
          <div className="bg-white shadow-md rounded-2xl p-4">
            <h2 className="text-lg font-semibold mb-2">Token Performance</h2>
            {chartData.length > 0 ? (
              <ResponsiveContainer width="100%" height={250}>
                <LineChart data={chartData}>
                  <XAxis dataKey="time" />
                  <YAxis />
                  <Tooltip />
                  <Line type="monotone" dataKey="value" stroke="#4f46e5" strokeWidth={2} />
                </LineChart>
              </ResponsiveContainer>
            ) : (
              <p className="text-sm text-gray-500">No performance data yet.</p>
            )}
            <button
              onClick={handleBoost}
              className="mt-4 w-full bg-purple-600 hover:bg-purple-700 text-white font-semibold py-2 px-4 rounded-xl transition"
            >
              Boost Token
            </button>
          </div>

          {/* Stats & Actions */}
          <div className="flex flex-col justify-between bg-white shadow-md rounded-2xl p-4">
            <div>
              <p className="text-lg font-medium text-gray-700">Total Income</p>
              <p className="text-3xl font-bold text-green-600">${income.toFixed(2)}</p>
            </div>
            <div className="mt-6 space-y-3">
              <button
                onClick={() => navigate('/referral')}
                className="w-full bg-blue-500 hover:bg-blue-600 text-white py-2 px-4 rounded-xl font-medium transition"
              >
                Referral Program
              </button>
              <button
                onClick={() => navigate('/leaderboard')}
                className="w-full bg-indigo-500 hover:bg-indigo-600 text-white py-2 px-4 rounded-xl font-medium transition"
              >
                View Leaderboard
              </button>
            </div>
          </div>
        </div>
      </div>
    </motion.div>
  );
};

export default Dashboard;
